In addition to knowing how to use mixed numbers, to solve this problem one also must recall two of the basic properties of exponents: \[a^b \cdot a^c = a^{b+c}\] and \[\left(l^m\right)^n = l^{m \cdot n}.\] Keeping these properties in mind, we can proceed with simplification \begin{align*}
\left(2^{\left(1\frac{1}{4}\right)}\right)^{\frac{2}{5}} \cdot \left(4^{\left(3\frac{1}{8}\right)}\right)^{\frac{2}{25}}
&= \left(2^{\frac{5}{4}}\right)^{\frac{2}{5}} \cdot \left(4^{\frac{25}{8}}\right)^{\frac{2}{25}}\\
&= 2^{\frac{5}{4} \cdot \frac{2}{5}} \cdot 4^{\frac{25}{8} \cdot \frac{2}{25}}\\
&= 2^{\frac{2}{4}} \cdot (2^2)^{\frac{2}{8}}\\
&= 2^{\frac{1}{2}} \cdot 2^{2 \cdot \frac{1}{4}}\\
&= 2^{\frac{1}{2}} \cdot 2^{\frac{1}{2}}\\
&= 2^{(\frac{1}{2} + \frac{1}{2})}\\
&= \boxed{2}.
\end{align*}

We see that \begin{align*}
2^{3^2} &= 2^{\left(3^2\right)} \\
&= 2^9 \\
&= \boxed{512}.
\end{align*}

For any $x$ and $y$, $(x+y)(x-y)=x^2-y^2+xy-xy=x^2-y^2$, so \begin{align*}
\left( \frac{1}{2} + \frac{1}{3} \right) \left( \frac{1}{2} - \frac{1}{3} \right)&=\left(\frac12\right)^2-\left(\frac13\right)^2\\
&=\frac14-\frac19\\
&=\frac{9}{36}-\frac{4}{36}\\
&=\boxed{\frac{5}{36}}
\end{align*}

We first substitute for $c$ to get \begin{align*} \frac{a+2}{a+1} \cdot \frac{b-1}{b-2} \cdot \frac{c+8}{c+6}
&= \frac{a+2}{a+1} \cdot \frac{b-1}{b-2} \cdot \frac{(b-10)+8}{(b-10)+6} \\
&= \frac{a+2}{a+1} \cdot \frac{b-1}{b-2} \cdot \frac{b-2}{b-4} . \end{align*} Since the denominators are not zero, we can cancel the $(b-2)$s to get \[ \frac{a+2}{a+1} \cdot \frac{b-1}{b-4} .\] Now, by the substitution $b= a+2$, this becomes \[ \frac{a+2}{a+1} \cdot \frac{(a+2)-1}{(a+2)-4} = \frac{a+2}{a+1} \cdot \frac{a+1}{a-2} . \] We can cancel as before to get \[ \frac{a+2}{a-2}, \] which is equal to $\dfrac{4+2}{4-2} = \dfrac{6}{2} = \boxed{3}$, since $a=4$.

We could also solve for $b$ and $c$ before simplifying.  Since $a= 4$, we have \[ b = a+2 = 4 + 2 = 6, \] and then \[ c = b - 10 = 6 - 10 = -4 . \] The expression then becomes \begin{align*}
\frac{a+2}{a+1} \cdot \frac{b-1}{b-2} \cdot \frac{c+8}{c+6}
&= \frac{4+2}{4+1} \cdot \frac{6-1}{6-2} \cdot \frac{-4 + 8}{-4 + 6} \\
&= \frac{6}{5} \cdot \frac{5}{4} \cdot \frac{4}{2} \\
&= \frac{6}{2} = \boxed{3}.
\end{align*}

We have \begin{align*}
(n-1) \cdot n &\cdot (n+1) \cdot (n+2) \cdot (n+3)\\
&= (2-1) \cdot 2 \cdot (2+1) \cdot (2+2) \cdot (2+3) \\
&= 1 \cdot 2 \cdot 3 \cdot 4 \cdot 5,
\end{align*} which is equal to $5!$, or $\boxed{120}$.

We could also multiply the last expression out by hand: \begin{align*}
(1 \cdot 2 \cdot 3) \cdot 4 \cdot 5 &= 6 \cdot 4 \cdot 5 \\
&= 6 \cdot 20 \\
&= 120 .
\end{align*}
